import React from "react";

import "./table.scss";

const Table = ({ table }) => {
  return (
    <div className="table-responsive table-wrapper">
      <table className="table table-hover my-table">
        <thead>
          <tr>
            {table.columns.map((column) => (
              <th>{column}</th>
            ))}
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>2</td>
            <td>3</td>
            <td>4</td>
            <td>5</td>
            <td>6</td>
            <td>7</td>
            <td>8</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Table;
